    {"title": "Harvard University", "text": "Harvard University is a private research university in Cambridge, Massachusetts (US), established 1636, whose history, influence and wealth have made it one of the world's most prestigious universities.", "tags": "", "url": "http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/1"},
    {"title": "Freedom Trial", "text": "Freedom Trail, a 2.5-mile, red-lined route that leads you to 16 historically significant sites — each one an authentic treasure. Explore museums and meetinghouses, churches, and burying grounds. Learn about the brave people who shaped our nation. Discover the rich history of the American Revolution, as it began in Boston, where every step tells a story.", "tags": "", "url": "http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/2"},
    {"title": "MIT", "text": "The Massachusetts Institute of Technology is an independent, coeducational, privately endowed university committed to the extension of knowledge through teaching and research. It is organized into five academic Schools — Architecture and Planning; Engineering; Humanities, Arts, and Social Sciences; Management; and Science — and numerous interdisciplinary programs and activities.", "tags": "", "url": "http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/3"},
    {"title":"Quincy Market","text":"Quincy Market is a historic market complex near Faneuil Hall in downtown Boston, Massachusetts. It was constructed in 1824–26 and named in honor of Mayor Josiah Quincy, who organized its construction without any tax or debt. The market was designated a National Historic Landmark, recognizing its significance as one of the largest market complexes built in the United States in the first half of the 19th century.","tags": "","url":"http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/4"},
    {"title":"Charles River","text":"Charles river is well known for its rowing, sculling, dragonboating, and sailing, both recreational and competitive. The river may also be kayaked; depending on the season, however, kayakers can only navigate the Charles by getting out and dragging their kayaks for significant stretches. The 'Lower Basin' between the Longfellow and Harvard bridges is home to Community Boating, the Harvard University Sailing Center, and the MIT Sailing Pavilion. The Head of the Charles Regatta is held here every October. In early June, the annual Hong Kong Boston Dragon boat Festival is held in Cambridge, near the Weeks Footbridge.","tags": "","url":"http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/5"},
    {"title":"Trinity Church","text":"Trinity Church is a thriving Christian community in the heart of Boston's Back Bay, and a member parish of the American Episcopal Church. Housed in a grand and historic building consistently ranked as one of America's most significant architectural landmarks, we are also a parish family drawing members from Boston and much of eastern Massachusetts.","tags": "","url":"http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/6"},
    {"title":"Boston Public Library","text":"The Boston Public Library is a municipal public library system in Boston, Massachusetts, United States, founded in 1848. The Boston Public Library is also the Library for the Commonwealth (formerly library of last recourse) of the Commonwealth of Massachusetts; all adult residents of the commonwealth are entitled to borrowing and research privileges, and the library receives state funding. The Boston Public Library contains approximately 23 million items encompassing all formats including books, DVDs, CDs, maps, music scores, microfilm, manuscripts, prints and other visual materials, and electronic resources, making it the second-largest public library in the United States behind only the Library of Congress.","tags": "","url":"http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/7"},
    {"title":"Museum of Fine Arts","text":"The MFA is one of the most comprehensive art museums in the world; the collection encompasses nearly 500,000 works of art. We welcome more than one million visitors each year to experience art from ancient Egyptian to contemporary, special exhibitions, and innovative educational programs. The Museum has undergone significant expansion and change in recent years; 2010 marked the opening of the Art of the Americas Wing, with four levels of American art from ancient to modern. In 2011, the west wing of the Museum was transformed into the Linde Family Wing for Contemporary Art, with new galleries for contemporary art and social and learning spaces. Improved and new galleries for European, Asian, and African art have opened through 2013, with more to come.","tags": "","url":"http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/8"},
    {"title":"Boston Common","text":"The starting point of the Freedom Trail, Boston Common is the oldest park in the country. The park is almost 50 acres in size. Today, Boston Common is the anchor for the Emerald Necklace, a system of connected parks that winds through many of Boston's neighborhoods. The 'Common' has been used for many different purposes throughout its long history. Until 1830, cattle grazed the Common, and until 1817, public hangings took place here. British troops camped on Boston Common prior to the Revolution and left from here to face colonial resistance at Lexington and Concord in April, 1775. Celebrities, including Martin Luther King Jr., Pope John Paul II, and Gloria Steinem (advocate of the feminist revolution), have given speeches at the Common.","tags": "","url":"http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/9"},
    {"title":"Copley Square","text":"If you’ve been to Boston once, you’ve most likely set foot in Copley Square. Located at the heart of the city, it is dedicated to that most illustrious native son, that painter of portraits, the one and only John Singleton Copley. As a place dedicated to an artist, it is a place for all walks to gather and commune. Perhaps on a fall day, you will come and buy some apples from local farmers. On another day, you might stop by for a bit of outdoor entertainment. But why stop by for just another afternoon or a lunch break? The delights of Copley Square are best enjoyed as part of a long, luxurious weekend and here’s what you should do during those days and nights.","tags": "","url":"http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/10"},
    {"title":"Prudential Tower","text":" Visit the Skywalk Observatory at Prudential Tower, Boston's only sky-high vantage point for sweeping 360 degree views of Greater Boston and beyond. Let your eyes and ears do the walking as you experience the exclusive state-of-the-art Acoustiguide audio tour detailing the city's many points of historic and cultural interest. Audio guides are provided in the following languages: English, Spanish, Dutch, French, Japanese and Mandarin.","tags": "","url":"http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/11"},
    {"title":"Fenway Park","text":"'America's Most Beloved Ballpark' is uniquely nestled in the city of Boston. Fenway Park is a place where dreams are made, traditions are celebrated and baseball is forever. See the home of Red Sox Legends, Williams, Yaz, Fisk and Rice. Visit Pesky's Pole and sit atop the world famous Green Monster which stands 37 feet 2 inches high overlooking leftfield. Our experienced tour guides will provide a thrilling, one hour, walking tour of Fenway Park. Bilingual tours are available in Spanish and Japanese with advance notice. We welcome all fans to Fenway Park, home of the Boston Red Sox and the pulse of Red Sox Nation.","tags": "","url":"http://webdev-yuxizhang.rhcloud.com/project/index.html#/attractions/12"}
